import './assets/css/App.css';


// Componentes
import Barra from './components/Barra';
import Router from './Router';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Barra />
      </header>
      <div className='center'>
        <Router />
      </div>
    </div>
  );
}

export default App;
